import Header from './section/header';
import axios from 'axios';

export default function Home() {
  const setting = axios.get('http://localhost:5000/').then(res => { console.log(res); return res.data }).catch(err => { console.log('Error: ' + err)});

  return (
    <>
      <Header setting={setting}/>
    </>
  );
}
